class Busca_Sucesso_Aluno extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div>
                <h1>Aluno: {this.props.nome}</h1>
                <h2>Situação: </h2><br/><br/>
                <label>Total De Horas Voo Aula: {this.props.total_horas_voo}</label>
            </div>
        )
      }
}
